import React from 'react';
import '../../App.css';
import Footer from '../Footer/Footer';

class E_sport extends React.Component {
  render(){
    return (
      <>
        <div className='e-sport'>Lien vers page esport LoL</div>
        <Footer />
      </>
    )
  }
}

export default E_sport;
